import React from 'react';
import '../../App.css';
import img1 from '../../images/img-1.jpg'; // Import your image

function Products() {
  return (
    <div
      className='products'
      style={{
        backgroundImage: `url(${img1})`, // Set the background image
        backgroundPosition: 'center',
        backgroundSize: 'cover', // Ensure the image covers the entire div
        backgroundRepeat: 'no-repeat',
        color: '#fff', // Change text color for visibility against the background
        height: '90vh', // Set height or other styles as needed
        display: 'flex', // Use flexbox to center the content
        alignItems: 'center',
        justifyContent: 'center',
        fontSize: '100px' // Set font size to match your design
      }}
    >
      <h1>PRODUCTS</h1>
      <Footer />
    </div>
  );
}

export default Products;
